class BindLogin{constructor(){this.IntuAPI=new IntuAPI}login(n,e){this.IntuAPI.checkAdmin(n,e).then(function(t){t?(window.sessionStorage.setItem("username",n),window.sessionStorage.setItem("password",e),window.location="/admin/settings"):window.location="/admin"})}signOut(){sessionStorage.removeItem("username"),sessionStorage.removeItem("password"),""!==window.location.pathname&&"/admin"!==window.location.pathname&&window.location.replace("/admin")}sendVcode(n){""!==n&&this.IntuAPI.sendVcode(n).then(function(n){})}resetPass(n,e,t){""!==n&&""!==t&&""!==e&&this.IntuAPI.resetPass(n,e,t).then(function(n){n?alert("Password changed"):alert("Error")})}}